# [2211] Count Collisions on a Road
#

# @lc code=start
class Solution:
    def countCollisions(self, directions: str) -> int:
        begin = 0
        while begin < len(directions) and directions[begin] == 'L':
            begin += 1
        end = len(directions)
        while end > 0 and directions[end - 1] == 'R':
            end -= 1

        return sum(0 if c == 'S' else 1 for c in directions[begin : end])

